import React, { Component } from 'react';

class MovieRow extends Component {
  render() {
    return <table key={movie.id}>
    <tbody>
      <tr>
        <td>
          <img alt="poster" width="150" src={movie.poster_src}/>
        </td>
        <td>
          {movie.title}
          <p>{movie.overview}</p>
        </td>
      </tr>
    </tbody>
  </table>
  }
}

export default MovieRow
